basics/map.html.body:
Créez une carte
Dans OpenLayers, une carte est une collection de couches avec plusieurs interactions et controls pour gérer les interactions utilisateurs. Une carte est générée avec trois ingrédients basiques: les balises, les déclarations de style et l'initialisation du code.
Exemple fonctionnel
Jetons un oeil à un exemple pleinement fonctionnel d'une carte OpenLayers.





      #map {
        height: 256px;
        width: 512px;
      }

    OpenLayers example



    My Map


      var map = new ol.Map({
        target: 'map',
        layers: [
          new ol.layer.Tile({
            title: 'Global Imagery',
            source: new ol.source.TileWMS({
              url: 'https://ahocevar.com/geoserver/wms',
              params: {LAYERS: 'nasa:bluemarble', TILED: true}
            })
          })
        ],
        view: new ol.View({
          projection: 'EPSG:4326',
          center: [0, 0],
          zoom: 0,
          maxResolution: 0.703125
        })
      });




Tâches

Assurez-vous d'avoir bien complété les instructions de configuration pour installer les dépendances et avoir le serveur de debug qui fonctionne.

Copiez le texte ci-dessus dans un nouveau fichier appelé map.html, et sauvez-le à la racine du répertoire du workshop.

Ouvrir la carte dans votre navigateur web: http://localhost:5173/map.html


Un carte fonctionnelle affichant une image du monde
Après avoir créé avec succès votre première carte, nous allons continuer en regardant plus précisément chacune des différentes parties.

basics/dissect.html.body:
Disséquez votre carte
Comme démontré dans la section précédente, une carte est générée en combinant balises, déclarations de style et code d'initialisation. Nous allons voir chacune de ces parties plus en détail.
Balise HTML pour la carte
La balise pour la carte dans l'exemple précédent génère un élément du DOM unique:


Cet élément  servira comme container de votre fenêtre d'affichage de carte. Ici, nous utilisons un élément , mais le container pour la fenêtre d'affichage de carte peut être n'importe quel élement de type "block".
Dans ce cas, nous donnons au container un attribut id afin que nous puissions le référencer comme cible target de notre carte.
Styles de carte
OpenLayers fournit une feuille de styles par défaut qui spécifie comment les principaux éléments liés à la carte devraient être stylés. Nous incluons explicitement cette feuille de style dans la page map.html ().
OpenLayers ne fait aucune supposition concernant la taille de la carte. Pour cette raison, en suivant la feuille de style par défaut, nous avons besoin d'inclure au moins une déclaration de style personnalisée pour donner de la place à la carte sur la page.


    #map {
      height: 256px;
      width: 512px;
    }


Dans ce cas, nous utilisons la valeur de l'id du container de la carte comme sélecteur et nous spécifions la largeur (512px) et la hauteur (256px) pour le container de la carte.
Les déclarations de style sont directement incluses dans le bloc  de notre document. Dans la plupart des cas, vos déclarations de style liées à la carte seront incluses dans un thème de site web plus important, référencé dans des feuilles de style externes.
Initialisation de la carte
La prochaine étape dans la génération de votre carte est d'inclure un peu de code pour l'initialisation. Dans notre cas, nous avons inclus un élément  en bas du corps de notre  pour faire le travail:

    var map = new ol.Map({
      target: 'map',
      layers: [
        new ol.layer.Tile({
          source: new ol.source.TileWMS({
            url: 'https://ahocevar.com/geoserver/wms',
            params: {LAYERS: 'nasa:bluemarble', TILED: true}
          })
        })
      ],
      view: new ol.View({
        projection: 'EPSG:4326',
        center: [0, 0],
        zoom: 0,
        maxResolution: 0.703125
      })
    });


L'ordre de ces étapes est important. Avant que notre script personnalisé puisse être exécuté, la bibliothèque OpenLayers doit impérativement être chargée. Dans notre exemple, la bibliothèque OpenLayers est chargée dans le bloc  de notre document avec .
De manière similaire, notre code d'initialisation de la carte (ci-dessus) ne peut être exécuté avant que l'élément du document qui sert de fenêtre d'affichage de carte, dans ce cas , ne soit chargé. En incluant, le code d'initialisation à la fin du corps de , nous nous assurons que la bibliothèque est chargée et que le container de la fenêtre d'affichage de carte est prêt avant de générer notre carte.
Regardons plus en détails ce que le script d'initialisation de la carte fait. Notre script créé un nouvel objet ol.Map avec quelques options de configuration:
  target: 'map'

Nous utilisons la valeur de l'attribut id du container de la fenêtre d'affichage de carte pour indiquer au constructeur de la carte où faire le rendu de la carte. Dans ce cas, nous passons "map" comme valeur de chaîne de caractères pour le paramètre target (cible) du constructeur de la carte. Cette syntaxe est un raccourci par commodité. Nous pourrions être plus explicite et fournir une référence directe à l'élément (c'est à dire document.getElementById("map")).
La configuration de couches créé une couche qui doit être affichée dans notre carte:
  layers: [
    new ol.layer.Tile({
      source: new ol.source.TileWMS({
        url: 'https://ahocevar.com/geoserver/wms',
        params: {LAYERS: 'nasa:bluemarble', TILED: true}
      })
    })
  ],

Ne vous inquiétez pas de la syntaxe ici si cette partie est nouvelle pour vous. La création de couches sera couverte dans un autre module. La partie importante à comprendre est que la vue de notre carte est une collection de couches. Pour pouvoir voir une carte, nous avons besoin au minimum d'une couche.
L'étape finale est de définir la vue. Nous spécifions une projection, un centre et un niveau de zoom. Nous spécifions aussi une maxResolution pour nous assurer que nous ne demandons pas des bounding boxes que GeoWebCache ne peut pas gérer.
  view: new ol.View({
     projection: 'EPSG:4326',
     center: [0, 0],
     zoom: 0,
     maxResolution: 0.703125
  })

Vous avez disséqué avec succès votre première carte! Maintenant, apprenons en plus sur le développement avec OpenLayers.

layers/wms.html.body:
Couches "Web Map Service" (WMS)
Quand vous ajoutez une couche à votre carte, la source de la couche est responsable typiquement d'appeler la donnée qui doit être affichée. La donnée demandée peut être soit raster, soit vecteur. Vous pouvez assimiler une donnée raster comme une information rendue comme une image côté serveur. La donnée vecteur est délivrée comme une information structurée depuis le serveur et peut potentiellement être calculée pour l'affichage via le client (votre navigateur).
Il y a  de nombreux types de services qui fournissent des données cartographiques raster. Cette section traite des fournisseurs qui se conforment à la spécification Web Map Service (WMS) de l'OGC (Open Geospatial Consortium, Inc.).
Créer une couche
Nous allons commencer avec un exemple complet de carte et modifier les couches pour pour avoir la compréhension de comment elles fonctionnent.
Jetez un oeil au code suivant:





      #map {
        height: 256px;
        width: 512px;
      }


    OpenLayers example


    My Map


      var map = new ol.Map({
        target: 'map',
        layers: [
          new ol.layer.Tile({
            title: 'Global Imagery',
            source: new ol.source.TileWMS({
              url: 'https://ahocevar.com/geoserver/wms',
              params: {LAYERS: 'nasa:bluemarble', TILED: true}
            })
          })
        ],
        view: new ol.View({
          projection: 'EPSG:4326',
          center: [0, 0],
          zoom: 0,
          maxResolution: 0.703125
        })
      });




Tâches

Si vous ne l'avez pas déjà fait, sauvez le texte ci-dessus comme map.html à la racine de votre répertoire workshop.

Ouvrez la page dans votre navigateur pour confirmer que les choses fonctionnent: http://localhost:5173/map.html


Le constructeur ol.layer.Tile
Le constructeur ol.layer.Tile nécessite un objet littéral de type olx.layer.TileOptions voir: http://openlayers.org/en/latest/apidoc/ol.layer.Tile.html
Dans ce cas, nous complétons la clé source des options avec une ol.source.TileWMS.
Un titre lisible par les humains pour la couche peut être fournie avec la clé title, mais n'importe quel nom pour la clé peut être utilisée ici.
Dans OpenLayers, il y a une séparation entre les couches et les sources alors que dans Openlayers 2, l'ensemble faisait partie d'une couche.
ol.layer.Tile représente un grille régulière d'images, ol.layer.Image représente une image seule. En fonction du type de couche, vous devrez ajouter une source différente (ol.source.TileWMS versus ol.source.ImageWMS) également.
Le constructeur ol.source.TileWMS
Le constructeur ol.source.TileWMS est un argument unique qui est définit par: http://openlayers.org/en/latest/apidoc/ol.source.TileWMS.html.
L'url est la online resource du service WMS, et params est un objet litéral avec les noms des paramètres et leurs valeurs. Seul le paramètre LAYERS est requis. Dans cet exemple, nous ajoutons TILED: true, une extension spécifique à GeoServer pour une meilleure mise en cache des couches WMS en mosaïque.
  layers: [
    new ol.layer.Tile({
      title: 'Global Imagery',
      source: new ol.source.TileWMS({
        url: 'https://ahocevar.com/geoserver/wms',
        params: {LAYERS: 'nasa:bluemarble', TILED: true}
      })
    })
  ]

Tâches

Ce même WMS offre une couche Natural Earth nommée 'ne:NE1_HR_LC_SR_W_DR'. Changez la valeur du paramètre LAYERS de 'nasa:bluemarble' à 'ne:NE1_HR_LC_SR_W_DR'.
Votre version mise à jour du constructeur ol.layer.Tile devrait ressembler à ci-dessous:
 new ol.layer.Tile({
   title: 'Global Imagery',
   source: new ol.source.TileWMS({
     url: 'https://ahocevar.com/geoserver/wms',
     params: {LAYERS: 'ne:NE1_HR_LC_SR_W_DR', TILED: true}
   })
 })


Changez votre couche et votre source pour avoir une image unique plutôt que des tuiles. Regardez aux pages de la documentation de l'API pour avoir des indices: http://openlayers.org/en/latest/apidoc/ol.layer.Image.html et http://openlayers.org/en/latest/apidoc/ol.source.ImageWMS.html. Utilisez l'onglet Réseau des outils de développement de votre navigateur pour vous assurer qu'une seule image est demandée et pas seulement des tuiles de 256x256 pixels.
Un WMS comme source image


Après avoir travaillé avec une donnée rendu dynamiquement depuis un Web Map Service, passons maintenant à l'utilisation des services de tuiles mises en cache.

layers/cached.html.body:
Tuiles mises en cache
Par défaut, Une couche de type Tile fait des requêtes pour des images de 256 x 256 (pixel) pour remplir votre fenêtre d'affichage de carte et au delà. Au fur et à mesure des déplacements et zoom sur votre carte, plus de requêtes vers des images seront effectuées pour remplir les surfaces que vous n'avez pas encore visitées. Pendant que votre navigateur mettra en cache quelques unes des images demandées, une part importante du travail de traitement est typiquement requis côté serveur pour faire le rendu des images dynamiquement.
Comme les couches tuilées font des appels à des images en utilisant une grille régulière, il est possible pour le serveur de mettre en cache ces images demandées et retourner le résultat mis en cache, la prochaine fois que vous ou quelqu'un d'autre visitez la même zone - résultant en de meilleures performances.
ol.source.XYZ
La spécification Web Map Service permet beaucoup de flexibilité par rapport à ce qu'un client peut demander. Sans contraintes, cela rend la mise en cache difficile ou impossible en pratique.
A l'extrême opposé, un service peut fournir des tuiles seulement à un jeu de niveaux de zoom fixe et seulement pour une grille régulière. Ce comportement peut être généralisé aux couches tuilées avec une source  de type XYZ - vous pouvez considérer que X et Y indiquent la colonne et la ligne de la grille et que le Z représente le niveau de zoom.
ol.source.OSM
Le projet OpenStreetMap (OSM) est un effort  pour collecter et mettre à disposition des données cartographiques pour l'ensemble du monde. OSM fournit différents types de rendus des données sous forme de jeux de tuiles mis en cache. Ces rendus se conforment à l'arrangement de grille XYZ basique et peuvent être utilisés dans une carte OpenLayers. La source de la couche ol.source.OSM permet d'accéder aux tuiles OpenStreetMap.
Tâches

Ouvrez le fichier map.html de la section précédente dans votre éditeur de texte et changez le code d'initialisation de la carte pour qu'il ressemble à celui qui suit:

   var map = new ol.Map({
     target: 'map',
     layers: [
       new ol.layer.Tile({
         source: new ol.source.OSM()
       })
     ],
     view: new ol.View({
       center: ol.proj.fromLonLat([126.97, 37.56]),
       zoom: 9
     }),
     controls: ol.control.defaults({
       attributionOptions: {
         collapsible: false
       }
     })
   });



Dans le bloc  du même document, ajoutez quelques déclarations de style pour l'attribution de la couche.

     #map {
         width: 512px;
         height: 256px;
     }
     .ol-attribution a {
         color: black;
     }



Sauvez vos changements et rafraichissez la page dans votre navigateur: http://localhost:5173/map.html
Une couche tuilée avec une source de type OSM


Revue de détails
Les projections
Revoyons la définition d'une vue dans la carte:
  view: new ol.View({
    center: ol.proj.fromLonLat([126.97, 37.56]),
    zoom: 9
  })

La donnée géospatiale peut venir dans n'importe quel système de coordonnées de référence. Un jeu de donnée peut utiliser des coordonnées géographiques (longitude et latitude) en degrés, et un autre peut avoir des coordonnées dans une projection locale avec des unités en mètres. Une discussion complète sur les systèmes de référence de coordonnées va bien au delà du périmètre de ce module mais il est néanmoins important de comprendre le concept de base.
OpenLayers doit connaître le système de coordonnées de votre donnée. En interne, cela est représenté avec un objet ol.proj.Projection mais des chaînes de caractère peuvent être aussi utilisées.
Les tuiles OpenStreetMap que nous utilisons sont dans une projection Mercator. Pour cette raison, nous devons définir initialement le centre en utilisant des coordonnées en Mercator. Comme il est relativement simple de trouver les coordonnées pour un point d'intérêt en coordonnées géographiques, nous utilisons la fonction ol.proj.fromLonLat pour transformer les coordonnées géographiques ('EPSG:4326') en coordonnées Mercator ('EPSG:3857').
Projections alternatives
OpenLayers inclut les transformation entre les systèmes de références de coordonnées géographiques ('EPSG:4326') et Web Mercator ('EPSG:3857').  Pour cette raison, nous pouvons utiliser la fonction ol.proj.fromLonLat ci-dessus sans aucun travail supplémentaire.  Si vous voulez travailler avec des données dans une projection différente, vous devez inclure des informations additionnelles avant d'utiliser les fonctions ol.proj.*.
Par exemple, si vous voulez travailler avec de la donnée dans le système de référence de coordonnées 'EPSG:21781', vous allez devoir inclure les deux tags script dans votre page:



Ensuite, dans le code de votre application, vous pouvez enregistrer cette projection et définir la validité de son étéendue comme ci-dessous:
  // This creates a projection object for the EPSG:21781 projection
  // and sets a "validity extent" in that projection object.
  var projection = ol.proj.get('EPSG:21781');
  projection.setExtent([485869.5728, 76443.1884, 837076.5648, 299941.7864]);

L'information d'étendue extent peut être retrouvée sur http://epsg.io/, en utilisant le code EPSG.
Création de couche
  layers: [
    new ol.layer.Tile({
      source: new ol.source.OSM()
    })
  ],

Comme précédemment, nous créons une couche et l'ajoutons au tableau de couches dans la configuration de notre objet carte map. Cette fois, nous acceptons toutes les options par défaut de la source.
Style
  .ol-attribution a {
    color: black;
  }

Un traitement des controls de la carte est en dehors du périmètre de ce module, mais ces déclarations de style vous donnent une léger avant-goût/aperçu. Par défaut, un control ol.control.Attribution est ajouté à toutes les cartes. Cela laisse les sources de couche afficher les informations d'attribution dans la fenêtre d'affichage de carte. Les déclarations ci-dessus changent le style de cette attribution pour notre carte (remarquez la ligne de Copyright au pied droit de la carte).
Configuration du control pour l'attribution
Par défaut, ol.control.Attribution ajoute un bouton i (information) qui peut être pressé pour afficher réellement l'information d'attribution. Pour se conformer aux termes d'utilisation d'OpenStreetMap, et toujours afficher l'information d'attribution d'OpenStreetMap, ce qui suit est utilisé dans les options de l'objet passé au constructeur ol.Map:
  controls: ol.control.defaults({
    attributionOptions: {
      collapsible: false
    }
  })

Cela enlève le bouton i, et rend l'information d'attribution toujours visible.
Après avoir maîtrisé les couches avec les jeux de tuiles mis en cache publics, passons au travail avec les couches raster propriétaires.

layers/proprietary.html.body:
Fournisseurs de tuiles propriétaires
Dans les sections précédentes, nous avons affiché des couches conformes au standard  WMS (OGC Web Map Service) et à des caches personnalisés de tuiles. Les cartes en ligne (ou du moins les clients de tuiles de carte) ont été largement popularisés par la disponibilité de services de tuiles de carte propriétaires. OpenLayers fournit de des types de couche qui fonctionnent avec ces services propriétaires via leurs APIs.
Dans cette section, nous allons repartir  de l'exemple développé dans la section précédente en ajoutant un couche utilisant des tuiles issues de Bing.
Bing!
Ajoutons un couche Bing.
Tâches

Dans votre fichier map.html, trouvez où la source OSM (OpenStreetMap) est configurée et changez-la en ol.source.BingMaps
 source: new ol.source.BingMaps({
   imagerySet: 'Road',
   key: ''
 })

Note - L'API de tuiles de Bing nécessite de que vous vous enregistriez pour avoir un clé d'API à utiliser pour votre application de cartographie en ligne.  L'exemple ici utilise une clé d'API que vous ne devriez pas utiliser en production.  pour utiliser la couche Bing en production, enregistrez-vous pour une clé d'API sur https://www.bingmapsportal.com.

Sauvez vos changements et rechargez map.html dans votre navigateur: http://localhost:5173/map.html
Une carte avec des tuiles d'un source de Bing Maps


Exemple fonctionnel complet
Votre fichier révisé map.html devrait ressembler à ceci:





      #map {
        height: 256px;
        width: 512px;
      }
      .ol-attribution a {
        color: black;
      }


    OpenLayers example


    My Map


      var map = new ol.Map({
        target: 'map',
        layers: [
          new ol.layer.Tile({
            source: new ol.source.BingMaps({
              imagerySet: 'Road',
              key: ''
            })
          })
        ],
        view: new ol.View({
          center: ol.proj.fromLonLat([126.97, 37.56]),
          zoom: 9
        })
      });

layers/vector.html.body:
Données vecteur
Les couches vecteur sont représentées par ol.layer.Vector et gère l'affichage côté client des données vecteur. Actuellement, OpenLayers supporte le rendu vecteur complet dans le moteur de rendu Canvas, mais seulement pour les points pour le moteur de rendu WebGL.
Rendu des objets géographiques côté client
Revenons à l'exemple WMS pour avoir une carte du monde basique.  Nous allons ajouter quelques données géographiques au dessus, dans une couche vecteur.





      #map {
        height: 256px;
        width: 512px;
      }

    OpenLayers example



    My Map


      var map = new ol.Map({
        target: 'map',
        layers: [
          new ol.layer.Tile({
            title: 'Global Imagery',
            source: new ol.source.TileWMS({
              url: 'https://ahocevar.com/geoserver/wms',
              params: {LAYERS: 'nasa:bluemarble', TILED: true}
            })
          })
        ],
        view: new ol.View({
          projection: 'EPSG:4326',
          center: [0, 0],
          zoom: 0,
          maxResolution: 0.703125
        })
      });




Tâches

Ouvrez map.html dans votre éditeur de texte et copiez dedans le contenu de votre exemple WMS initial. Sauvez vos changements et confirmez que les choses fonctionnent bien dans votre navigateur: http://localhost:5173/map.html

Dans votre code d'initialisation de la carte, ajoutez une autre couche après la couche tuilée (collez ce qui suit). Cela ajoute une nouvelle couche vecteur à votre carte qui demande un jeu d'objets géographiques sous format GeoJSON:
 new ol.layer.Vector({
   title: 'Earthquakes',
   source: new ol.source.Vector({
     url: '/data/layers/7day-M2.5.json',
     format: new ol.format.GeoJSON()
   }),
   style: new ol.style.Style({
     image: new ol.style.Circle({
       radius: 3,
       fill: new ol.style.Fill({color: 'white'})
     })
   })
 })

Emplacements de tremblements de terre


Revue de détails
Examinons la création de cette couche vecteur pour se faire une idée de ce qu'il se passe.
new ol.layer.Vector({
  title: 'Earthquakes',
  source: new ol.source.Vector({
    url: '/data/layers/7day-M2.5.json',
    format: new ol.format.GeoJSON()
  }),
  style: new ol.style.Style({
    image: new ol.style.Circle({
      radius: 3,
      fill: new ol.style.Fill({color: 'white'})
    })
  })
})

La couche se voit donner le titre (title) 'Earthquakes' et quelques options personnalisées. Dans les options de l'objet, nous avons inclus une source de type ol.source.Vector qui pointe vers une URL. Nous avons donné à la source un format qui sera utilisé pour parser les données.
Note - Dans le cas où vous souhaiteriez styler les objets géographiques en utilisant un attribut, vous devrez utiliser une fonction style plutôt qu'un ol.style.Style dans les options de configuration du style de la couche ol.layer.Vector.
Tâches bonus

Les cercles blancs sur la carte représentent des objets ol.Feature sur votre couche ol.layer.Vector. Chacun de ces objets a des données d'attributs les propriétés title et summary. Assignez un événement de type 'singleclick' sur votre carte qui appelle forEachFeatureAtPixel sur la carte et affiche les informations de tremblements de terre en dessous de la fenêtre d'affichage de carte.

La donnée pour la couche vecteur vient du flux d'information sur les tremblements de terre publié par l'USGS (http://earthquake.usgs.gov/earthquakes/catalogs/).  Voyez si vous pouvez trouver des données additionnelles avec des informations spatiales dans un format supporté par OpenLayers.  Si vous sauvegardez un autre document représentant des données spatiales dans votre répertoire data, vous devriez être capable de le voir dans une couche vecteur sur votre carte.


Solutions
Comme solution à la première tâche bonus, vous pouvez ajouter une div info en dessous de la carte:


et ajouter le code JavaScript suivant pour afficher le titre de l'objet cliqué:
map.on('singleclick', function(e) {
  var feature = map.forEachFeatureAtPixel(e.pixel, function(feature) {
    return feature;
  });
  var infoElement = document.getElementById('info');
  infoElement.innerHTML = feature ? feature.get('title') : '';
});

layers/imagevector.html.body:
Source image vecteur
Dans l'exemple précédent utilisant une couche ol.layer.Vector, vous pouvez voir que les objets géographiques ont été recalculés en permanence pendant le zoom animé (la taille des symboles de points reste fixe).  Avec une couche vecteur, OpenLayers refera le rendu de la source avec chaque frame de l'animation.  Cela fournit un rendu consistant des traits de ligne, des symboles de points  et des étiquettes avec les changements de résolution de la vue.
Une stratégie alternative de rendu est d'éviter de refaire le rendu pendant les transitions de la vue et à la place de repositionner et mettre à l'échelle la sortie depuis l'état de la vue précédente.  Cela peut être accompli en utilisant une ol.layer.Image avec une ol.source.ImageVector.  Avec cette combinaison, des "snapshots" de votre donnée sont rendus quand la vue n'est pas animée, et ces snapshots sont réutilisés pendant les transitions de vue.
L'exemple ci-dessous utilise une ol.layer.Image avec une ol.source.ImageVector.  Bien que cet exemple fasse seulement un rendu d'une petite quantité de données, cette combinaison serait plus appropriée pour les applications qui font une rendu de grandes quantités de données relativement statiques.
ol.source.ImageVector
Revenons à l'exemple de couche vecteur pour avoir les données des tremblements de terre au dessus d'une carte du monde.





      #map {
        height: 256px;
        width: 512px;
      }

    OpenLayers example



    My Map


      var map = new ol.Map({
        target: 'map',
        layers: [
          new ol.layer.Tile({
            title: 'Global Imagery',
            source: new ol.source.TileWMS({
              url: 'https://ahocevar.com/geoserver/wms',
              params: {LAYERS: 'nasa:bluemarble', TILED: true}
            })
          }),
          new ol.layer.Vector({
            title: 'Earthquakes',
            source: new ol.source.Vector({
